func sayCommand() *cobra.Command {
	return &cobra.Command{
		Use:   "say",
		Short: "Print Zarf logo",
		Long:  "Print out the adorable Zarf logo",
		RunE: func(_ *cobra.Command, _ []string) error {
			_, err := fmt.Fprintln(os.Stderr, logo())
			return err
		},
	}
}

